import React from 'react'
import "../Live1/Live1.css"
export default card=(props,itemimg,itemname,itemprice) => {
  return (
    <>
    <div className='cards'>
        <div className="itemname">{props.itemname}</div>
        <div className="price">{props.itemprice}</div>
    </div>
    </>
  );
};
